import React from "react";
import { BrowserRouter as Router, Route } from "react-router-dom";
import EC2DashboardPage from "./components/EC2DashboardPage";
import PagefirstTable from "./components/PagefirstTable";

function App() {
  return (
    <Router>
      {/* <Route exact path="/" component={EC2DashboardPage} /> */}
      <Route path="/pagefirstTable" component={PagefirstTable} />
    </Router>
  );
}

export default App;
